// FRONTEND/src/Components/account/Login/Login.jsx
import React, { useState, useEffect, useRef } from 'react';
import axios from 'axios';
import { gsap } from 'gsap';
import { useNavigate } from 'react-router-dom';
import './Login.css';

const Login = () => {
  const [formData, setFormData] = useState({
    email: '',
    password: '',
  });
  const [showPassword, setShowPassword] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const formRef = useRef(null);
  const navigate = useNavigate();

  useEffect(() => {
    const elements = formRef.current.querySelectorAll('.animate');
    gsap.fromTo(
      elements,
      {
        x: () => `${Math.random() * 200 - 100}px`,
        y: () => `${Math.random() * 200 - 100}px`,
        opacity: 0,
      },
      { x: 0, y: 0, opacity: 1, duration: 0.5, stagger: 0.1 }
    );
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');

    try {
      const { data } = await axios.post('http://localhost:5000/auth/login', formData);
      setSuccess('Login successful!');
      localStorage.setItem('auth-token', data.token);
      navigate('/'); // Redirect to the homepage
    } catch (error) {
      console.error('Login error:', error);
      setError(error.response?.data?.message || 'Invalid email or password.');
    }
  };

  const togglePasswordVisibility = () => {
    setShowPassword(!showPassword);
  };

  const handleForgotPassword = () => {
    // Redirect to forgot password page or show OTP input
    navigate('/forgot-password');
  };

  return (
    <section>
      <div className="login-container" ref={formRef}>
        <div className="page-header animate">
          <div className="page-header__text-wrapper text-container">
            <h1 className="heading h2">Login</h1>
            <p>Enter your credentials below:</p>
          </div>
        </div>
        {error && <div className="error-message">{error}</div>}
        {success && <div className="success-message">{success}</div>}
        <div className="page-content page-content--small">
          <div className="account__block-list">
            <div className="account__block-item">
              <form onSubmit={handleSubmit} className="form">
                <div className="input animate">
                  <input
                    type="email"
                    id="email"
                    name="email"
                    placeholder="Email"
                    value={formData.email}
                    onChange={handleChange}
                    required
                  />
                </div>
                <div className="input animate">
                  <input
                    type={showPassword ? 'text' : 'password'}
                    id="password"
                    name="password"
                    placeholder="Password"
                    value={formData.password}
                    onChange={handleChange}
                    required
                  />
                  <span
                    onClick={togglePasswordVisibility}
                    className={`show-password-icon ${showPassword ? 'visible' : ''}`}
                  >
                    üëÅÔ∏è
                  </span>
                </div>
                <div className="login__action">
                  <button type="submit" className="btn">Login</button>
                </div>
              </form>
              <div className="forgot-password">
                <button onClick={handleForgotPassword} className="forgot-password-btn">
                  Forgot Password?
                </button>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Login;
